import './Header.css';
import { NavLink } from 'react-router-dom'

function Header() {
  return (
      <div className="header">
        <NavLink to="/">HOME</NavLink>
        <a href="/merch">MERCH</a>
        <img src="/components/DuckyLogo.png"></img>
        <a href="/merch">SIGNUP</a>
        <a href="/merch">CONTACT</a>
      </div>
  );
}

export default Header;
